import React from "react";

class Education extends React.Component {
  render() {
    return (
      <div
        id="experience"
        style={MainDiv}
        data-aos="fade-down"
        data-aos-duration="9000"
      >
        <div style={Heading}>
          <div>Education</div>
        </div>
        <div className="container">
            <div className="card" style={{backgroundColor: "#F8DD74", width: "50%"}}>NEU</div>
            <div className="card" style={{backgroundColor: "#F8DD74", width: "50%"}}>GTU</div>
        </div>
      </div>
    );
  }
}

const MainDiv = {
    marginTop: "70px",
  };

  const Heading = {
    justifyContent: "center",
    display: "flex",
    fontWeight: "bold",
    fontSize: "40px",
    fontFamily: "playfair display",
    color: "#193964",
    padding: "3%",
  };

export default Education;
